import React from "react";
import { useDispatch } from "react-redux";
import { toggleMenu } from "./utils/appSlice";

const Header = () => {
  const dispatch = useDispatch();

  const toggleMenuHandler = () => {
    dispatch(toggleMenu());
  };

  return (
    <div className="grid grid-flow-col justify-between m-2 p-2">
      <div className="flex col-span-1">
        <img
          onClick={toggleMenuHandler}
          className="cursor-pointer w-12 h-12"
          src="data:image/png;base64,"
          alt="menu"
        />
        Link
      </div>

      <div className="flex col-span-10 justify-center">
        <input
          className="border rounded-l-full  w-5/12"
          type="text"
          name="search"
          id=""
        />
        <button className="rounded-r-full border p-3 px-8">
          <img
            className="w-5 h-5"
            src="https://cdn-icons-png.flaticon.com/512/54/54481.png"
            alt=""
          />
        </button>
      </div>

      <div className="flex col-span-1">
        <img
          className="w-12 h-12 mx-4"
          src="data:image/png;base64,"
          alt="rec"
        />
        <img
          className="w-12 h-12 mx-4"
          src="data:image/png;base64,"
          alt="user"
        />
      </div>
    </div>
  );
};

export default Header;
